import SearchBar from "../SearchBar";
import { Link } from "react-router-dom";
export default function Nav(props) {

    return (
        <div style={{
            width: '100%',
            backgroundColor: 'gray',

            display: 'flex',
            position:'relative',

        }}>
            <div style={{ right: 0 }}><SearchBar onSearch={props.onSearch} /></div>

            <div style={{ display: 'flex', 
            position:'absolute', 
            right:'50%', 
            alignContent:'center',
            alignItems:'center'
            }}>
                <div><Link to={"/home"}><button >Home</button></Link></div>
                <div><Link to={"/about"}><button>About</button></Link></div>
            </div>


        </div>
    );

}
